/**
    * @description      : 
    * @author           : belgacem
    * @group            : 
    * @created          : 18/12/2023 - 23:39:16
    * 
    * MODIFICATION LOG
    * - Version         : 1.0.0
    * - Date            : 18/12/2023
    * - Author          : belgacem
    * - Modification    : 
**/
import React, { useState } from 'react';
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  FlatList,
  StyleSheet,
} from 'react-native';

// ... (imports remain unchanged)

const TodoItem = ({ item, onEdit, onDelete }) => (
    <View style={styles.taskItem}>
      <Text>{item.text}</Text>
      <View style={styles.buttonsContainer}>
        <TouchableOpacity style={styles.actionButton} onPress={() => onEdit(item)}>
          <Text style={styles.buttonText}>Edit</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.actionButton} onPress={() => onDelete(item.id)}>
          <Text style={styles.buttonText}>Delete</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
  
  const TodoList = () => {
    const [tasks, setTasks] = useState([]);
    const [taskText, setTaskText] = useState('');
    const [editingTask, setEditingTask] = useState(null);
  
    const handleAddTask = () => {
      if (taskText.trim() !== '') {
        if (editingTask !== null) {
          handleUpdateTask();
        } else {
          setTasks((prevTasks) => [
            ...prevTasks,
            { id: Date.now().toString(), text: taskText },
          ]);
          setTaskText('');
        }
      }
    };
  
    const handleUpdateTask = () => {
      if (editingTask !== null && taskText.trim() !== '') {
        setTasks((prevTasks) =>
          prevTasks.map((task) =>
            task.id === editingTask.id ? { ...task, text: taskText } : task
          )
        );
        setTaskText('');
        setEditingTask(null);
      }
    };
  
    const handleDeleteTask = (taskId) => {
      setTasks((prevTasks) => prevTasks.filter((task) => task.id !== taskId));
      setEditingTask(null);
    };
  
    const renderItem = ({ item }) => (
      <TodoItem
        item={item}
        onEdit={(editedTask) => {
          setEditingTask(editedTask);
          setTaskText(editedTask.text);
        }}
        onDelete={handleDeleteTask}
      />
    );
  
    return (
      <View style={styles.container}>
        <TextInput
          style={styles.input}
          placeholder="Add or Edit a task"
          value={taskText}
          onChangeText={setTaskText}
        />
        <View style={styles.buttonRow}>
          <TouchableOpacity style={styles.actionButton} onPress={handleAddTask}>
            <Text style={styles.buttonText}>
              {editingTask ? 'Update Task' : 'Add Task'}
            </Text>
          </TouchableOpacity>
          {editingTask && (
            <TouchableOpacity
              style={styles.actionButton}
              onPress={() => {
                setTaskText('');
                setEditingTask(null);
              }}
            >
              <Text style={styles.buttonText}>Cancel</Text>
            </TouchableOpacity>
          )}
        </View>
        <FlatList data={tasks} keyExtractor={(item) => item.id} renderItem={renderItem} />
      </View>
    );
  };
  
  // ... (styles remain unchanged)
  


const styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 20,
      backgroundColor: '#f4f4f4',
    },
    input: {
      borderWidth: 1,
      borderColor: '#ccc',
      padding: 12,
      marginBottom: 10,
      borderRadius: 8,
      backgroundColor: '#fff',
    },
    addButton: {
      backgroundColor: '#3498db',
      padding: 12,
      alignItems: 'center',
      borderRadius: 8,
      marginBottom: 10,
    },
    updateButton: {
      backgroundColor: '#2ecc71', // Change the color to a green shade
      padding: 12,
      alignItems: 'center',
      borderRadius: 8,
      marginBottom: 10,
    },
    deleteButton: {
      backgroundColor: '#e74c3c',
      padding: 12,
      alignItems: 'center',
      borderRadius: 8,
      marginBottom: 10,
    },
    buttonText: {
      color: '#fff',
      fontWeight: 'bold',
    },
    taskItem: {
      borderWidth: 1,
      borderColor: '#ccc',
      padding: 15,
      marginBottom: 10,
      flexDirection: 'row',
      justifyContent: 'space-between',
      alignItems: 'center',
      borderRadius: 8,
      backgroundColor: '#fff',
    },
    buttonsContainer: {
      flexDirection: 'row',
    },
    buttonRow: {
      flexDirection: 'row',
      justifyContent: 'space-between',
    },
  });
  
  export default TodoList;
